import React from 'react';
import {Table} from 'react-bootstrap';

function TransferList() {

  return (

    <Table striped bordered hover>
  <thead>
    <tr>
      <th>Id</th>
      <th>Amount</th>
      <th>approvals</th>
      <th>sent</th>
    </tr>
  </thead>
  <tbody>
    {TransferList.map(transfer=>(
      <tr>
        <td>1</td>
        <td>Mark</td>
        <td>Otto</td>
        <td>@mdo</td>
    </tr>
    ))}


  </tbody>
</Table>
  );
}

export default TransferList;
